import React, {Component, Fragment} from 'react'
import Question from './Question'

class Game extends Component{
    state={
        correct: 0
    }
    render(){
        return(
            <Fragment>
                {this.props.questions.map(q => <Question data={q}/>)}
            </Fragment>
        )
    }
}

export default Game
